import React from "react";

import classes from "./Key.module.css";
import { IoClose } from "react-icons/io5";

const Key = () => {
  return (
    <li className={classes.key}>
      <span className={classes.key__text}>Testnet</span>
      <button className={classes.btn__icon}>
        <ion-icon
          className={classes.key__delete}
          name="close-outline"
        ></ion-icon>
      </button>
    </li>
  );
};

export default Key;
